const MultiAppContainer = () => {
  return (
    <div className="multi-app-container">
      <div id="app-wrapper-1" className="app-wrapper">
        <App />
      </div>
      <div id="app-wrapper-2" className="app-wrapper">
        <App />
      </div>
    </div>
  )
}

createRoot(document.getElementById('root')).render(<MultiAppContainer />)
